  font-size: 54px;
  text-shadow: 1.7px 0.7px 0px $primary-color, 2px 1px 0px white;
  text-align: center;
  margin: 1rem 1rem;

  width: 100%;
  @include mobile {
    font-size: 28px;
  }
}

