.home {
  width: 100vw;
  height: 100vh;
  margin-bottom: 4rem;
  position: relative;
  background-image: url("./../assets/landing_img.png");
  background-repeat: no-repeat;
  background-size: cover;
  background-position: bottom;

  &__rectangle {
    position: absolute;
    width: 100%;
    height: 100%;
    left: 50%;
    bottom: 0;
    transform: translateX(-50%);
    display: flex;
    flex-direction: column;
    align-items: start;

    // background: #ffc936;
    // border-radius: 8px 8px 0 0;

    @include mobile {
      width: 85%;
    }
    &__icon {
      // background-image: url("./../assets/logo_bg.png");
      background-repeat: no-repeat;
      background-size: cover;
      background-position: bottom;
      position: absolute;
      right: 0;
      top: 10%;
      transform: translate(10%, 0%);
      height: 500px;
      width: 500px;
      border-radius: 4px;
      display: grid;
      place-items: center;
      @include mobile {
        height: 26vh;
        width: 26vh;
        z-index: -1;
        opacity: 0.5;
        right: -10%;
        top: 5%;
      }
      img {
        height: 90%;
        width: 90%;
        margin-left: -10px;
        opacity: 0.5;
      }
    }
    &__content {
      width: 40%;
      color: #ffffff;
      margin-top: 14.5%;
      font-size: 18px;
      font-weight: 300;
      line-height: 150%;
      text-align: justify;
      display: flex;
      flex-direction: column;
      margin-left: 5rem;
      z-index: 1;

      @include mobile {
        margin: auto;
        margin-bottom: 0rem;
        width: 90%;
        font-size: 1.8vh;
      }
      & > p {
        margin: auto auto 2rem auto;
      }
      &__dates {
        padding-top: 0.6rem;
