          font-size: 36px;
          font-weight: 500;
          margin: 0 16px;
          color: $secondary-color;
          @include mobile {
            font-size: 3.4vh;
          }
        }
        .date__from {
          margin-top: -24px;
        }
        .date__to {
          margin-bottom: -18px;
        }
      }
    }
