      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: end;
      width: 80%;
      height: 100%;
      position: absolute;
      top: 0;
      right: 15%;

      @include mobile {
        align-items: flex-end;
        right: 5%;
      }

      color: $accent-color;

      p {
        font-weight: 500;
        margin: 10px 0;
        font-size: 20px;
        text-align:right;

